def calculate_minimum_years(n: str) -> int:

    def sub(maxs, mins):
        for i in range(len(maxs)):
            if maxs[i] != mins[i]:
                if i == len(maxs) - 1:
                    return int(maxs[i]) - int(mins[i])
                if i == len(maxs) - 2:
                    return int(maxs[i:i + 2]) - int(mins[i:i + 2])
                return 10
        return 1

    def checkEqual(S):
        ans = 8
        for k in range(1, len(S)):
            if len(S) % k != 0:
                continue
            mins = maxs = S[0:k]
            for s in range(0, len(S), k):
                maxs = max(maxs, S[s:s + k])
                mins = min(mins, S[s:s + k])
            ans = min(ans, sub(maxs, mins))
        return ans

    def check12(S):
        maxv = 0
        minv = 10
        p = 0
        while p < len(S):
            v = int(S[p])
            if S[p] == '1' and p + 1 < len(S):
                v = 10 + int(S[p + 1])
                p += 1
            maxv = max(maxv, v)
            minv = min(minv, v)
            p += 1
        return maxv - minv
    return min(checkEqual(n), check12(n))

